import React from "react";
import { Container, Col, Row } from "react-bootstrap";
import airplane from './images/airplane.png';
import agent from './images/agent.png';
import footerBg from './images/cloud.jpg'; // your background image

const Footer = () => {
  return (
    <div className="footer-bg">
      {/* White container for content */}
      <Container className="footer-white-box">
        <Row className="g-4 justify-content-between">
          {/* Mission Section */}
          <Col md={4}>
            <h3 className="footer-heading">Our Mission</h3>
            <img src={airplane} className="footer-image" alt="airplane"/>
            <p>
              We help you find the perfect travel tour at the best price, tailored to your unique preferences. 
            </p>
          </Col>

          {/* Contact Section */}
          <Col md={4} className="footer-centered">
            <h3 className="footer-heading">Contact</h3>
            <p><i className="fa-solid fa-phone"></i> (+355) 686044497</p>
            <p><i className="fa-brands fa-whatsapp"></i> (+355) 696044498</p>
            <p><i className="fa-brands fa-instagram"></i> global.wingsTravel</p>
            <p><i className="fa-brands fa-facebook"></i> Global Wings Travel Tour</p>
            <p><i className="fa-sharp fa-regular fa-location-dot"></i> global.wings@hotmail.com</p>
          </Col>

          {/* Brand Section */}
          <Col md={4} className="footer-centered">
            <h3 className="footer-heading">Global Wings</h3>
            <p>Your Gateway to the World</p>
            <img src={agent} className="footer-image" alt="agent"/>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Footer;
